  return (
    <Motion style={{ y: spring(y, { stiffness: 170, damping: 26 }) }}>
      {({ y }) => (
        <div
          className="moving-object"
          style={{
            ...style,
            transform: `translateY(${y}px)`,
          }}
          onTransitionEnd={handleElevetorArrived}
        />
      )}
    </Motion>
  );
};

export default Elevator;
